import "./index.css"

function Links(props){
    const links = []
    for(const tab of ["Home", "Gnome"]){
        links.push(
            <div className="navele" key={tab} onClick={() => {props.changeTab(tab)}}>{tab}</div>
        )
    }
    return (
        <div id="navbar"> 
            {links}
        </div>
    )
}
export default Links
